INSERT INTO `av` VALUES ('周末去爬山看桃花  看到了魔幻集市  结果我又“走...', 'av47654018/', 'TuTu生活志', '03/29 15:14', '(日常)', '上周末，tutu趁着桃花盛开的时节，和亲友去爬龙泉山，没想到更热闹的是因此衍生出来的“魔幻集市”。一路走走停停，到处打望，看到了不少勾起童年回忆的小物件，忍不住入手了，居然还意外发现了一个新奇的玩具。不过，这集市的环境也太… 临近傍晚，一行人爬到半山腰，看到零零散散的几处桃林，合影、录像、细细观赏后便从小路而下，再次穿过集市的另一边离开了。晚饭后，驱车经过龙泉山脉回家，漫山遍野的桃花美不胜收，回想起十年前山上的样貌，几乎没有什么变化，但人的心境已大不同。', '//i2.hdslb.com/bfs/archive/6f8d46d3eaf6f13f38e04d27fa81469938f733bd.jpg', '300000', '512', '601', '50', '40', '20', '10');
